import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_desktop.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_desktop.png'));

    // Set a mobile viewport to make the mobile menu visible
    await page.setViewportSize({ width: 375, height: 667 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_view.png'));

    // Find and click the mobile menu trigger ("All" button)
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_open.png'));

    // Extract text from menu items to verify content
    const electronicsLink = mobileMenuOverlay.getByRole('link', { name: 'Electronics' });
    const booksLink = mobileMenuOverlay.getByRole('link', { name: 'Books' });

    const extractedData = {
      electronicsLinkText: await electronicsLink.textContent(),
      booksLinkText: await booksLink.textContent(),
      isMenuVisible: await mobileMenuOverlay.isVisible()
    };

    // Click a link in the menu (e.g., Electronics)
    await electronicsLink.click();

    // Since it's a static page, we'll just verify the menu is still open and then close it.
    // In a real app, we would verify navigation.

    // Find and click the close button within the mobile menu
    const closeButton = mobileMenuOverlay.locator('button.close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Wait for the mobile menu overlay to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, interacted with, and closed the mobile menu.",
      extractedData: {
        ...extractedData,
        isMenuClosed: await mobileMenuOverlay.isHidden()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
